A sequence of positive integers is defined by the following pattern:
\begin{align*}
a_1 &= 1 \\
a_{n+1} &= \text{the smallest integer not in the sequence} \{ a_n \} \{ a_{n-1} \} \{ a_{n-2} \} \cdots \{ a_1 \}
\end{align*}
For example, to compute $a_3$, we consider the sequence's elements as $\{a_1, a_2, a_3\} = \{1, a_2, a_3\}$. The value $a_2$ must be at least 2 (so that it is not considered in the smallest integer not found in the sequence of the first two elements), and the value $a_3$ must be at least 3 (so that $a_4$ could potentially be 4, resulting in the rule change).
What is $a_5$?

Cassie is thinking of two positive integers. She gives her friend Dustin a sequence of five positive integers, and tells him:

- If one of the numbers in the sequence is 1 or 2, I'll say, "Yes.";
- If none of the numbers in the sequence is 1 or 2, I'll say, "No.";

After Dustin asks as many questions as he wants, Cassie will answer, "Yes" or "No". What is the maximum number of questions Dustin can guarantee to determine the two numbers Cassie is thinking of?

