a_{\lfloor k/2 \rfloor } &= \frac{\sum\limits_{j=0}^k a_j}{k+1} \quad \forall k \geq 0.
\end{align*}

If $ a_2 = 1$ and $a_6 = \frac{10}{11}$, find $a_1$.

